snippet.description:
Disponível para Android na Google Play.

Corra e salte através das armadilhas e inimigos. Cuidado com os diversos obstáculos, plataformas móveis, espinhos, poços e outros perigos mortais. 

Se você é fã de desafios, este jogo será seu favorito. Mostre que você é bom e supere seu próprio record.

Características do jogo:
- Resolução em HD;
- 4 personagens jogáveis;
- Alta qualidade gráfica;
- Mais de 34 fases diferentes;
- Fases com dificuldades diferentes;
- Sistema randômico de fases;
- Upload a cada semana com novas fases;
- Um PowerUp;
- 2 Chefões;
- Mais de 17 inimigos.

Google Play: https://play.google.com/store/apps/details?id=com.gorpaki.superdangeroustrap

